import React from "react";
import "./Carousel.css";

export default (props) => {

 return <div className="carousel">
 { props.imageSrc ? <img src={props.imageSrc} alt="jojo villains" /> : <img src="data:image/png;base64," alt="placeholder"></img> }

</div>;
};
